// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
//Main class that will be used to perform operation on our block.
contract SendMoneyWithApproval
{
    address public sender;
    address public receiver;
    address public approver;
    uint public amount;

  function deposit(address _sender, address _receiver, address _approver, uint _amount) {
    sender = _sender;
    receiver = _receiver;
    approver = _approver;
    amount = _amount;
  }

  function viewApprover() external view returns(address) {
    return(approver);
  }
   function approve() external {  
     (receiver).transfer(amount * (1 ether));
   }


   function send(address _addr) payable public  returns (bool){
          _addr.transfer(amount * (1 ether));
          return true;
    }
